void CINTdmat_transpose(dtype *a_t, dtype *a, FINT m, FINT n)
{
        FINT i, j, k;

        for (j = 0; j < n-3; j+=4) {
//#pragma GCC ivdep

                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] = a[i*n+j+0];
                        a_t[(j+1)*m+i] = a[i*n+j+1];
                        a_t[(j+2)*m+i] = a[i*n+j+2];
                        a_t[(j+3)*m+i] = a[i*n+j+3];
                }
        }

        //printf("n-j: %d\n", n-j);

        switch (n-j) {
                case 1:
        //#pragma GCC ivdep
                        for (i = 0; i < m; i++) {
                                a_t[j*m+i] = a[i*n+j];
                        }
                        break;
                case 2:
        //#pragma GCC ivdep
                        for (i = 0; i < m; i++) {
                                a_t[(j+0)*m+i] = a[i*n+j+0];
                                a_t[(j+1)*m+i] = a[i*n+j+1];
                        }
                        break;
                case 3:
        //#pragma GCC ivdep
                        for (i = 0; i < m; i++) {
                                a_t[(j+0)*m+i] = a[i*n+j+0];
                                a_t[(j+1)*m+i] = a[i*n+j+1];
                                a_t[(j+2)*m+i] = a[i*n+j+2];
                        }
                        break;
        }
}


void CINTdplus_transpose(dtype *a_t, dtype *a, FINT m, FINT n)
{
        FINT i, j, k;

        for (j = 0; j < n-3; j+=4) {
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] += a[i*n+j+0];
                        a_t[(j+1)*m+i] += a[i*n+j+1];
                        a_t[(j+2)*m+i] += a[i*n+j+2];
                        a_t[(j+3)*m+i] += a[i*n+j+3];
                }
        }

        switch (n-j) {
        case 1:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[j*m+i] += a[i*n+j];
                }
                break;
        case 2:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] += a[i*n+j+0];
                        a_t[(j+1)*m+i] += a[i*n+j+1];
                }
                break;
        case 3:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] += a[i*n+j+0];
                        a_t[(j+1)*m+i] += a[i*n+j+1];
                        a_t[(j+2)*m+i] += a[i*n+j+2];
                }
                break;
        }
}


void CINTzmat_transpose(dtype *a_t, dtype *a, FINT m, FINT n)
{
        FINT i, j;

        switch (n) {
        case 2:
                for (i = 0; i < m; i++) {
                        a_t[i  ] = a[2*i+0];
                        a_t[i+m] = a[2*i+1];
                }
                break;
        default:
                switch (m) {
                case 2: for (i = 0; i < n; i++) {
                                a_t[2*i+0] = a[i  ];
                                a_t[2*i+1] = a[i+n];
                        }
                        break;
                default:
                        for (i = 0; i < n; i++) {
                                for (j = 0; j < m; j++) {
                                        a_t[i*m+j] = a[j*n+i];
                                }
                        }
                }
        }
}


void CINTdgemm_NN1(FINT m, FINT n, FINT k,
                   dtype *a, dtype *b, dtype *c, FINT ldc)
{
        FINT i, j, kp;
        dtype bi;
        for (j = 0; j < n; j++) {
                for (i = 0; i < m; i++) {
                        c[i+ldc*j] = 0;
                }
                for (kp = 0; kp < k; kp++) {
                        bi = b[kp+k*j];
#pragma GCC ivdep
                        for (i = 0; i < m; i++) {
                                c[i+ldc*j] += a[i+m*kp] * bi;
                        }
                }
        }
}

void CINTdgemm_NN(FINT m, FINT n, FINT k,
                  dtype *a, dtype *b, dtype *c)
{
        CINTdgemm_NN1(m, n, k, a, b, c, m);
}

void CINTdgemm_TN(FINT m, FINT n, FINT k,
                  dtype *a, dtype *b, dtype *c)
{
        FINT i, j, kp;
        dtype ci;
        for (j = 0; j < n; j++) {
                for (i = 0; i < m; i++) {
                        ci = 0;
#pragma GCC ivdep
                        for (kp = 0; kp < k; kp++) {
                                ci += a[kp+k*i] * b[kp+k*j];
                        }
                        c[i+m*j] = ci;
                }
        }
}

void CINTdgemm_NT(FINT m, FINT n, FINT k,
                  dtype *a, dtype *b, dtype *c)
{
        FINT i, j, kp;
        dtype bi;
        for (j = 0; j < n; j++) {
                for (i = 0; i < m; i++) {
                        c[i+m*j] = 0;
                }
                for (kp = 0; kp < k; kp++) {
                        bi = b[j+n*kp];
#pragma GCC ivdep
                        for (i = 0; i < m; i++) {
                                c[i+m*j] += a[i+m*kp] * bi;
                        }
                }
        }
}


