static void a_ket_cart2spinor(dtype *gspR, dtype *gspI,
                              dtype *gcartR, dtype *gcartI,
                              FINT nbra, FINT kappa, FINT l)
{
        FINT nf = _len_cart[l];
        FINT nf2 = nf * 2;
        FINT nd = _len_spinor(kappa, l);
        dtype *coeffR, *coeffI;
        if (kappa < 0) { 
                coeffR = g_c2s[l].cart2j_gt_lR;
                coeffI = g_c2s[l].cart2j_gt_lI;
        } else {
                coeffR = g_c2s[l].cart2j_lt_lR;
                coeffI = g_c2s[l].cart2j_lt_lI;
        }

        FINT i, j, n;
        dtype cR, cI, gR, gI;

        for (i = 0; i < nd; i++) {
#pragma GCC ivdep
                for (j = 0; j < nbra; j++) {
                        gspR[j+i*nbra] = 0;
                        gspI[j+i*nbra] = 0;
                }
                for (n = 0; n < nf2; n++) {
                        cR = coeffR[i*nf2+n];
                        cI = coeffI[i*nf2+n];
                        if (cR != 0) {
                                if (cI != 0) {
#pragma GCC ivdep
                                        for (j = 0; j < nbra; j++) {
                                                gR = gcartR[j+n*nbra];
                                                gI = gcartI[j+n*nbra];
                                                gspR[j+i*nbra] += cR * gR - cI * gI;
                                                gspI[j+i*nbra] += cI * gR + cR * gI;
                                        }
                                } else {
#pragma GCC ivdep
                                        for (j = 0; j < nbra; j++) {
                                                gR = gcartR[j+n*nbra];
                                                gI = gcartI[j+n*nbra];
                                                gspR[j+i*nbra] += cR * gR;
                                                gspI[j+i*nbra] += cR * gI;
                                        }
                                }
                        } else {
                                if (cI != 0) {
#pragma GCC ivdep
                                        for (j = 0; j < nbra; j++) {
                                                gR = gcartR[j+n*nbra];
                                                gI = gcartI[j+n*nbra];
                                                gspR[j+i*nbra] +=-cI * gI;
                                                gspI[j+i*nbra] += cI * gR;
                                        }
                                }
                        }
                }
        }
}


