{
        a_ket1_cart2spinor(gspI, gspR, gcartR, gcartI, nbra, counts, kappa, l);
        FINT size = _len_spinor(kappa, l) * nbra * counts;
        FINT i;
        for (i = 0; i < size; i++) {
                gspR[i] = -gspR[i];
        }
}



