void c2s_dset0(dtype *out, FINT *dims, FINT *counts)
{
        FINT ni = dims[0];
        FINT nj = dims[1];
        FINT nk = dims[2];
        size_t nij = ni * nj;
        size_t nijk = nij * nk;
        FINT i, j, k, l;
        if (dims == counts) {
                for (i = 0; i < nijk * counts[3]; i++) {
                        out[i] = 0;
                }
                return;
        }
        FINT di = counts[0];
        FINT dj = counts[1];
        FINT dk = counts[2];
        FINT dl = counts[3];
        dtype *pout;
        for (l = 0; l < dl; l++) {
                for (k = 0; k < dk; k++) {
                        pout = out + k * nij;
                        for (j = 0; j < dj; j++) {
                        for (i = 0; i < di; i++) {
                                pout[j*ni+i] = 0;
                        } }
                }
                out += nijk;
        }
}
void c2s_zset0(dtype *out, FINT *dims, FINT *counts)
{
        FINT ni = dims[0];
        FINT nj = dims[1];
        FINT nk = dims[2];
        size_t nij = ni * nj;
        size_t nijk = nij * nk;
        FINT i, j, k, l;
        if (dims == counts) {
                for (i = 0; i < nijk * counts[3]; i++) {
                        out[i] = 0;
                }
                return;
        }
        FINT di = counts[0];
        FINT dj = counts[1];
        FINT dk = counts[2];
        FINT dl = counts[3];
        dtype *pout;
        for (l = 0; l < dl; l++) {
                for (k = 0; k < dk; k++) {
                        pout = out + k * nij;
                        for (j = 0; j < dj; j++) {
                        for (i = 0; i < di; i++) {
                                pout[j*ni+i] = 0;
                        } }
                }
                out += nijk;
        }
}

