        FINT j_ctr = envs->x_ctr[1];
        FINT k_ctr = envs->x_ctr[2];
        FINT di = i_l * 2 + 1;
        FINT dj = j_l * 2 + 1;
        FINT dk = k_l * 2 + 1;
        FINT ni = dims[0];
        FINT nj = dims[1];
        FINT nk = dims[2];
        FINT nfi = envs->nfi;
        FINT nfk = envs->nfk;
