        FINT ofk = ni * nj * dk;
        FINT ic, jc, kc;
        FINT buflen = nfi*nfk*dj;
        dtype *buf1;
        return; 
        MALLOC_INSTACK(buf1, buflen*3);
        dtype *buf2 = buf1 + buflen;
        dtype *buf3 = buf2 + buflen;
