void CINTc2s_bra_spinor_e1sf(dtype *gsp, FINT nket,
                             dtype *gcart, FINT kappa, FINT l)
{
        FINT nf = _len_cart[l];
        FINT nd = _len_spinor(kappa, l);
        dtype *gspa = (dtype *)gsp;
        dtype *gspb = gspa + nket * nd * OF_CMPLX;
        dtype *coeffR, *coeffI;
        if (kappa < 0) { 
                coeffR = g_c2s[l].cart2j_gt_lR;
                coeffI = g_c2s[l].cart2j_gt_lI;
        } else {
                coeffR = g_c2s[l].cart2j_lt_lR;
                coeffI = g_c2s[l].cart2j_lt_lI;
        }

        FINT i, j, n;
        dtype saR, saI, sbR, sbI, caR, caI, cbR, cbI, v1;

        for (j = 0; j < nket; j++) {
        for (i = 0; i < nd; i++) {
                saR = 0;
                saI = 0;
                sbR = 0;
                sbI = 0;
#pragma GCC ivdep
                for (n = 0; n < nf; n++) {
                        v1 = gcart[j*nf+n];
                        caR = coeffR[i*nf*2   +n];
                        caI = coeffI[i*nf*2   +n];
                        cbR = coeffR[i*nf*2+nf+n];
                        cbI = coeffI[i*nf*2+nf+n];
                        saR += caR * v1;
                        saI +=-caI * v1;
                        sbR += cbR * v1;
                        sbI +=-cbI * v1;
                }
                gspa[(j*nd+i)*OF_CMPLX  ] = saR;
                gspa[(j*nd+i)*OF_CMPLX+1] = saI;
                gspb[(j*nd+i)*OF_CMPLX  ] = sbR;
                gspb[(j*nd+i)*OF_CMPLX+1] = sbI;
        } }
}

