void CINTc2s_ket_spinor_sf1(dtype *gspa, dtype *gspb, dtype *gcart,
                            FINT lds, FINT ldc, FINT nctr, FINT kappa, FINT l)
{
        FINT nf = _len_cart[l];
        FINT nd = _len_spinor(kappa, l);
        dtype *gspaz = (dtype *)gspa;
        dtype *gspbz = (dtype *)gspb;
        dtype *coeffR, *coeffI;
        if (kappa < 0) { 
                coeffR = g_c2s[l].cart2j_gt_lR;
                coeffI = g_c2s[l].cart2j_gt_lI;
        } else {
                coeffR = g_c2s[l].cart2j_lt_lR;
                coeffI = g_c2s[l].cart2j_lt_lI;
        }

        FINT i, j, k, n;
        dtype caR, caI, cbR, cbI, v1;

        for (k = 0; k < nctr; k++) {
                for (i = 0; i < nd; i++) {
#pragma GCC ivdep
                        for (j = 0; j < ldc; j++) {
                                gspaz[(j+i*lds)*OF_CMPLX  ] = 0;
                                gspaz[(j+i*lds)*OF_CMPLX+1] = 0;
                                gspbz[(j+i*lds)*OF_CMPLX  ] = 0;
                                gspbz[(j+i*lds)*OF_CMPLX+1] = 0;
                        }
                        for (n = 0; n < nf; n++) {
                                caR = coeffR[i*nf*2   +n];
                                caI = coeffI[i*nf*2   +n];
                                cbR = coeffR[i*nf*2+nf+n];
                                cbI = coeffI[i*nf*2+nf+n];
#pragma GCC ivdep
                                for (j = 0; j < ldc; j++) {
                                        v1 = gcart[j+n*ldc];
                                        gspaz[(j+i*lds)*OF_CMPLX  ] += caR * v1;
                                        gspaz[(j+i*lds)*OF_CMPLX+1] += caI * v1;
                                        gspbz[(j+i*lds)*OF_CMPLX  ] += cbR * v1;
                                        gspbz[(j+i*lds)*OF_CMPLX+1] += cbI * v1;
                                }
                        }
                }
                gspaz += nd * lds * OF_CMPLX;
                gspbz += nd * lds * OF_CMPLX;
                gcart += nf * ldc;
        }
}

void CINTc2s_iket_spinor_sf1(dtype *gspa, dtype *gspb, dtype *gcart,
                             FINT lds, FINT ldc, FINT nctr, FINT kappa, FINT l)
{
        FINT nf = _len_cart[l];
        FINT nd = _len_spinor(kappa, l);
        dtype *gspaz = (dtype *)gspa;
        dtype *gspbz = (dtype *)gspb;
        dtype *coeffR, *coeffI;
        if (kappa < 0) { 
                coeffR = g_c2s[l].cart2j_gt_lR;
                coeffI = g_c2s[l].cart2j_gt_lI;
        } else {
                coeffR = g_c2s[l].cart2j_lt_lR;
                coeffI = g_c2s[l].cart2j_lt_lI;
        }

        FINT i, j, k, n;
        dtype caR, caI, cbR, cbI, v1;

        for (k = 0; k < nctr; k++) {
                for (i = 0; i < nd; i++) {
#pragma GCC ivdep
                        for (j = 0; j < ldc; j++) {
                                gspaz[(j+i*lds)*OF_CMPLX  ] = 0;
                                gspaz[(j+i*lds)*OF_CMPLX+1] = 0;
                                gspbz[(j+i*lds)*OF_CMPLX  ] = 0;
                                gspbz[(j+i*lds)*OF_CMPLX+1] = 0;
                        }
                        for (n = 0; n < nf; n++) {
                                caR = coeffR[i*nf*2   +n];
                                caI = coeffI[i*nf*2   +n];
                                cbR = coeffR[i*nf*2+nf+n];
                                cbI = coeffI[i*nf*2+nf+n];
#pragma GCC ivdep
                                for (j = 0; j < ldc; j++) {
                                        v1 = gcart[j+n*ldc];
                                        gspaz[(j+i*lds)*OF_CMPLX  ] -= caI * v1;
                                        gspaz[(j+i*lds)*OF_CMPLX+1] += caR * v1;
                                        gspbz[(j+i*lds)*OF_CMPLX  ] -= cbI * v1;
                                        gspbz[(j+i*lds)*OF_CMPLX+1] += cbR * v1;
                                }
                        }
                }
                gspaz += nd * lds * OF_CMPLX;
                gspbz += nd * lds * OF_CMPLX;
                gcart += nf * ldc;
        }
}

