#ifdef HAVE_QUADMATH_H
//#include <quadmath.h>
#endif
#define PIE4        0.78539816339744827900
#define THRESHOLD_ZERO  (DBL_EPSILON * 8)
#define SMALLX_LIMIT    3e-7

static int rys_root1(dtype x, dtype *roots, dtype *weights);
static int rys_root2(dtype x, dtype *roots, dtype *weights);
static int rys_root3(dtype x, dtype *roots, dtype *weights);
static int rys_root4(dtype x, dtype *roots, dtype *weights);
static int rys_root5(dtype x, dtype *roots, dtype *weights);
typedef int QuadratureFunction(int n, dtype x, dtype lower, dtype *roots, dtype *weights);
#ifndef HAVE_QUADMATH_H
#define CINTqrys_schmidt        CINTlrys_schmidt
#define CINTqrys_laguerre       CINTlrys_laguerre
#define CINTqrys_jacobi         CINTlrys_jacobi
#endif

int _CINT_polynomial_roots(dtype *roots, dtype *cs, int nroots){return 0;}

static int segment_solve(int n, dtype x, dtype lower, dtype *u, dtype *w,
                         dtype breakpoint, QuadratureFunction fn1, QuadratureFunction fn2)
{
        int error;
        if (x <= breakpoint) {
                error = fn1(n, x, lower, u, w);
        } else {
                error = fn2(n, x, lower, u, w);
        }
        if (error) {
                error = CINTqrys_schmidt(n, x, lower, u, w);
        }
        return error;
}

void CINTrys_roots(int nroots, dtype x, dtype *u, dtype *w)
{
        if (x <= SMALLX_LIMIT) {
                int off = nroots * (nroots - 1) / 2;
                int i;
                for (i = 0; i < nroots; i++)  {
                        u[i] = POLY_SMALLX_R0[off+i] + POLY_SMALLX_R1[off+i] * x;
                        w[i] = POLY_SMALLX_W0[off+i] + POLY_SMALLX_W1[off+i] * x;
                }
                return;
        } else if (x >= 35+nroots*5) {
                int off = nroots * (nroots - 1) / 2;
                int i;
                dtype rt;
                dtype t = sqrt(PIE4/x);
                for (i = 0; i < nroots; i++)  {
                        rt = POLY_LARGEX_RT[off+i];
                        u[i] = rt / (x - rt);
                        w[i] = POLY_LARGEX_WW[off+i] * t;
                }
                return;
        }

        int err;
        switch (nroots) {
        case 1:
                err = rys_root1(x, u, w);
                break;
        case 2:
                err = rys_root2(x, u, w);
                break;
        case 3:
                err = rys_root3(x, u, w);
                break;
        case 4:
                err = rys_root4(x, u, w);
                break;
        case 5:
                err = rys_root5(x, u, w);
                break;
        case 6: case 7:
                err = segment_solve(nroots, x, 0., u, w, 11, CINTrys_jacobi, CINTrys_schmidt);
                break;
        case 8:
                err = segment_solve(nroots, x, 0., u, w, 11, CINTrys_jacobi, CINTlrys_schmidt);
                break;
        case 9:
                err = segment_solve(nroots, x, 0., u, w, 10, CINTlrys_jacobi, CINTlrys_laguerre);
                break;
        case 10: case 11:
                err = segment_solve(nroots, x, 0., u, w, 18, CINTlrys_jacobi, CINTlrys_laguerre);
                break;
        case 12:
                err = segment_solve(nroots, x, 0., u, w, 22, CINTlrys_jacobi, CINTlrys_laguerre);
                break;
        default:
                err = segment_solve(nroots, x, 0., u, w, 50, CINTqrys_jacobi, CINTqrys_laguerre);
        }
        if (err) {
                //fprintf(stderr, "rys_roots fails: nroots=%d x=%g\n",
                //       nroots, x);
#ifndef KEEP_GOING
                exit(err);
#endif
        }
}


static int segment_solve1(int n, dtype x, dtype lower, dtype *u, dtype *w,
                          dtype lower_bp1, dtype lower_bp2, dtype breakpoint,
                          QuadratureFunction fn1, QuadratureFunction fn2, QuadratureFunction fn3)
{
        int error;
        if (lower < lower_bp1) {
                if (x <= breakpoint) {
                        error = fn1(n, x, lower, u, w);
                } else {
                        error = fn2(n, x, lower, u, w);
                }
        } else if (lower < lower_bp2) {
                error = fn3(n, x, lower, u, w);
        } else {
                return 1;
        }
        if (error) {
                error = CINTqrys_schmidt(n, x, lower, u, w);
        }
        return error;
}

void CINTsr_rys_roots(int nroots, dtype x, dtype lower, dtype *u, dtype *w)
{
        int err = 1;
        switch (nroots) {
        case 1:
                err = CINTrys_schmidt(nroots, x, lower, u, w);
                break;
        case 2:
                if (lower < 0.99) {
                        err = CINTrys_schmidt(nroots, x, lower, u, w);
                } else {
                        err = CINTqrys_jacobi(nroots, x, lower, u, w);
                }
                break;
        case 3:
#ifdef WITH_POLYNOMIAL_FIT
                if (lower < 0.6) {
                        err = CINTsr_rys_polyfits(nroots, x, lower, u, w);
                        if (err == 0) {
                                break;;
                        }
                }
#endif
                if (lower < 0.93) {
                        err = CINTrys_schmidt(nroots, x, lower, u, w);
                } else if (lower < 0.97) {
                        err = segment_solve(nroots, x, lower, u, w, 10, CINTlrys_jacobi, CINTlrys_laguerre);
                } else {
                        err = CINTqrys_jacobi(nroots, x, lower, u, w);
                }
                break;
        case 4:
#ifdef WITH_POLYNOMIAL_FIT
                if (lower < 0.6) {
                        err = CINTsr_rys_polyfits(nroots, x, lower, u, w);
                        if (err == 0) {
                                break;;
                        }
                }
#endif
                if (lower < 0.8) {
                        err = CINTrys_schmidt(nroots, x, lower, u, w);
                } else if (lower < 0.9) {
                        err = segment_solve(nroots, x, lower, u, w, 10, CINTlrys_jacobi, CINTlrys_laguerre);
                } else {
                        err = CINTqrys_jacobi(nroots, x, lower, u, w);
                }
                break;
        case 5:
#ifdef WITH_POLYNOMIAL_FIT
                if (lower < 0.6) {
                        err = CINTsr_rys_polyfits(nroots, x, lower, u, w);
                        if (err == 0) {
                                break;;
                        }
                }
#endif
                if (lower < 0.4) {
                        err = segment_solve(nroots, x, lower, u, w, 50, CINTrys_schmidt, CINTlrys_laguerre);
                } else if (lower < 0.8) {
                        err = segment_solve(nroots, x, lower, u, w, 10, CINTlrys_jacobi, CINTlrys_laguerre);
                } else {
                        err = CINTqrys_jacobi(nroots, x, lower, u, w);
                }
                break;
        case 6:
                if (lower < 0.25) {
                        err = segment_solve(nroots, x, lower, u, w, 60, CINTrys_schmidt, CINTlrys_laguerre);
                } else if (lower < 0.8) {
                        err = segment_solve(nroots, x, lower, u, w, 10, CINTlrys_jacobi, CINTlrys_laguerre);
                } else {
                        err = CINTqrys_jacobi(nroots, x, lower, u, w);
                }
                break;
        case 7:
                err = segment_solve1(nroots, x, lower, u, w, 0.5, 1., 60, CINTlrys_jacobi, CINTlrys_laguerre, CINTqrys_jacobi);
                break;
        case 8: case 9: case 10:
                
                err = segment_solve1(nroots, x, lower, u, w, 0.15, 1., 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 11: case 12:
                err = segment_solve1(nroots, x, lower, u, w, 0.15, 1., 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 13: case 14:
                err = segment_solve1(nroots, x, lower, u, w, 0.25, 1., 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 15: case 16:
                err = segment_solve1(nroots, x, lower, u, w, 0.25, 0.75, 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 17:
                segment_solve1(nroots, x, lower, u, w, 0.25, 0.65, 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 18:
                segment_solve1(nroots, x, lower, u, w, 0.15, 0.65, 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 19:
                err = segment_solve1(nroots, x, lower, u, w, 0.15, 0.55, 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 20: case 21:
                err = segment_solve1(nroots, x, lower, u, w, 0.25, 0.45, 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        case 22: case 23: case 24:
                err = segment_solve1(nroots, x, lower, u, w, 0.25, 0.35, 60, CINTqrys_jacobi, CINTqrys_laguerre, CINTqrys_jacobi);
                break;
        default:
                //fprintf(stderr, "libcint SR-rys_roots does not support nroots=%d\n", nroots);
#ifndef KEEP_GOING
                exit(1);
#endif
        }
        if (err) {
                //fprintf(stderr, "sr_rys_roots fails: nroots=%d x=%.15g lower=%.15g\n",
                //        nroots, x, lower);
#ifndef KEEP_GOING
                exit(err);
#endif
        }
}

