#define POLYNOMIAL_VALUE1(p, a, order, x) \
p = a[order]; \
for (i = 1; i <= order; i++) { \
        p = p * x + a[order-i]; \
}

#define SET_ZERO(a, n, start) \
        for (k = start; k < n; ++k) { \
                for (i = 0; i < n; ++i) { \
                        a[i + k * n] = 0; \
                } \
        } \

static int R_dsmit(dtype *cs, dtype *fmt_ints, int n)
{
        int i, j, k;
        dtype fac, dot, tmp;
        dtype v[MXRYSROOTS];

        fac = -fmt_ints[1] / fmt_ints[0];
        tmp = fmt_ints[2] + fac * fmt_ints[1];
        if (tmp <= 0) {
                //fprintf(stderr, "libcint::rys_roots negative value in sqrt for roots %d (j=1)\n", n-1);
                SET_ZERO(cs, n, 1);
                return 1;
        }
        tmp = 1 / sqrt(tmp);
        cs[0+0*n] = 1 / sqrt(fmt_ints[0]);
        cs[0+1*n] = fac * tmp;
        cs[1+1*n] = tmp;

        for (j = 2; j < n; ++j) {
                for (k = 0; k < j; ++k) {
                        v[k] = 0;
                }
                fac = fmt_ints[j + j];
                for (k = 0; k < j; ++k) {
                        dot = 0;
                        for (i = 0; i <= k; ++i) {
                                dot += cs[i + k * n] * fmt_ints[i+j];
                        }
                        for (i = 0; i <= k; ++i) {
                                v[i] -= dot * cs[i + k * n];
                        }
                        fac -= dot * dot;
                }

                if (fac <= 0) {
                        
                        SET_ZERO(cs, n, j);
                        if (fac == 0) {
                                return 0;
                        }
                        //fprintf(stderr, "libcint::rys_roots negative value in sqrt for roots %d (j=%d)\n", n-1, j);
                        return j;
                }
                fac = 1 / sqrt(fac);
                cs[j + j * n] = fac;
                for (k = 0; k < j; ++k) {
                        cs[k + j * n] = fac * v[k];
                }
        }
        return 0;
}


static int _rdk_rys_roots(int nroots, dtype *fmt_ints,
                          dtype *roots, dtype *weights)
{
        int i, k, j, order;
        int nroots1 = nroots + 1;
        dtype rt[MXRYSROOTS + MXRYSROOTS * MXRYSROOTS];
        dtype *cs = rt + nroots1;
        dtype *a;
        dtype root, poly, dum;

        
        if (fmt_ints[0] == 0) {
                for (k = 0; k < nroots; ++k) {
                        roots[k] = 0;
                        weights[k] = 0;
                }
                return 0;
        }
        if (nroots == 1) {
                roots[0] = fmt_ints[1] / (fmt_ints[0] - fmt_ints[1]);
                weights[0] = fmt_ints[0];
                return 0;
        }

        int error = R_dsmit(cs, fmt_ints, nroots1);
        if (error) {
                return 1;
        }
        error = _CINT_polynomial_roots(rt, cs, nroots);
        if (error) {
                return error;
        }

        for (k = 0; k < nroots; ++k) {
                root = rt[k];
                
                
                
                
                if (root == 1) {
                        roots[k] = 0;
                        weights[k] = 0;
                        continue;
                }

                dum = 1 / fmt_ints[0];
                for (j = 1; j < nroots; ++j) {
                        order = j;
                        a = cs + j * nroots1;
                        
                        POLYNOMIAL_VALUE1(poly, a, order, root);
                        dum += poly * poly;
                }
                roots[k] = root / (1 - root);
                weights[k] = 1 / dum;
        }
        return 0;
}

int CINTrys_schmidt(int nroots, dtype x, dtype lower, dtype *roots, dtype *weights)
{
        dtype fmt_ints[MXRYSROOTS*2];
        if (lower == 0) {
                gamma_inc_like(fmt_ints, x, nroots*2);
        } else {
                fmt_erfc_like(fmt_ints, x, lower, nroots*2);
        }
        return _rdk_rys_roots(nroots, fmt_ints, roots, weights);
}


